import React from "react";
import { FormGroup, FormControlLabel, Checkbox, FormLabel } from "@material-ui/core";


const CheckBoxInfo = () => {
    return (
        <FormGroup row>
        <FormLabel>When did you run?</FormLabel>
            <FormControlLabel control={<Checkbox name="hs" />} label="High School" />
            <FormControlLabel control={<Checkbox name="col" />} label="College" />
            <FormControlLabel control={<Checkbox name="pc" />} label="Post-College" />
            <FormControlLabel control={<Checkbox name="pro" />} label="Professional" />
            <FormControlLabel control={<Checkbox name="sp" />} label="Semi Pro" />
            <FormControlLabel control={<Checkbox name="o" />} label="Other" />
        </FormGroup>
      );
}

export default CheckBoxInfo;
